raw_logs = [raw_log1, raw_log2, raw_log3, raw_log4, raw_log5]

def remove_auc_lines(log_text):
    """
    从日志文本中移除包含AUC指标的行
    """
    lines = log_text.split('\n')
    # 过滤掉包含 "AUC:" 或 "'AUC'" 的行
    filtered_lines = [line for line in lines if not (re.search(r'AUC[\s:]+', line) or "'AUC'" in line)]
    return '\n'.join(filtered_lines)

def process_logs(log_list):
    """
    处理多个日志并打印结果
    """
    for i, log in enumerate(log_list, 1):
        print(f"=== Processed raw_log{i} ===")
        processed_log = remove_auc_lines(log)
        print(processed_log)
        print("\n" + "="*50 + "\n")

# 执行处理
if __name__ == "__main__":
    process_logs(raw_logs)